import { default as React } from 'react';

import * as Routes from '../../routes';

import './blog.scss';

const Blog = ({link, img, title, context}) => {

	return (
		<a href={link} className="blog">
			<img alt="img_of_blog" src={img}></img>
			<div className="blog__wrapper">
				<h1>{title}</h1>
				<p>{context}</p>
			</div>
		</a>
	);
};

export default Blog;
